import React from 'react';
import { Route, BrowserRouter } from 'react-router-dom';
import Home from './Home';
import './App.css';

function App() {
	return (
		<div className="App">
			<Switch>
				<Route exact path="/">
					<Home />
				</Route>
			</Switch>
		</div>
	);
}

export default App;
